package com.prm.java.practice.forloop;

public class SquareOfSequenceNumbers {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		System.out.println("Here you will see Sequare of the numbers from 1 to 5");
		
		//for(int i=1; i<=5;i++){}
		

		
		for(int j=1; j<=5;j++){
			
			int num = j*j;
			
			System.out.println(num);
		}
		
	
		
	}

}
